import React from 'react';
import { Button, ListGroup } from 'react-bootstrap';

const FoodLog = ({ foodEntries }) => {
    return (
        <div className="mt-4">
            <h3>Food Log</h3>
            <input type="text" placeholder="Search for food" className="form-control mb-3" />
            <Button variant="primary">Add New Meal</Button>
            <ListGroup className="mt-3">
                {foodEntries.map((entry, index) => (
                    <ListGroup.Item key={index}>{entry.name}: {entry.calories} kcal</ListGroup.Item>
                ))}
            </ListGroup>
        </div>
    );
};

export default FoodLog;
